import React from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Logout = () => {
  const navigate = useNavigate();

  const handleLogout = async () => {
    try {
      // Gọi API để thực hiện logout từ server
      await axios.post("http://localhost:8080/api/users/logout");

      // Điều hướng đến trang đăng nhập hoặc trang chính (tùy thuộc vào yêu cầu của bạn)
      navigate("/login");
    } catch (error) {
      console.error("Logout failed:", error);
      // Xử lý lỗi nếu cần
    }
  };

  return (
<div id="logo" class="flex-col logo">

           <a href="https://shop.mixigaming.com/" title="MixiShop - MixiShop" rel="home">
               <img width="151" height="100" src="https://shop.mixigaming.com/wp-content/uploads/2019/06/logo-mixi-tét.png" class="header_logo header-logo" alt="MixiShop"/>
               <img width="151" height="100" src="https://shop.mixigaming.com/wp-content/uploads/2019/06/logo-mixi-tét.png" class="header-logo-dark" alt="MixiShop"/>
               </a>
                     </div>















  );
};

export default Logout;
